// index.js or another high-level component
import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { InternshipProvider } from './hooks/InternshipContext';
import { JobProvider } from './hooks/JobContext';
import { SkillDevelopmentProvider } from './hooks/SkillDevelopmentContext'; // Import SkillDevelopmentProvider

ReactDOM.render(
  <React.StrictMode>
    <InternshipProvider>
      <JobProvider>
        <SkillDevelopmentProvider> {/* Wrap your component tree with SkillDevelopmentProvider */}
          <App />
        </SkillDevelopmentProvider>
      </JobProvider>
    </InternshipProvider>
  </React.StrictMode>,
  document.getElementById('root')
);
